import React from 'react';
import Particles from 'react-tsparticles';
import logoImage from '../images/js.png'; // Replace with your logo image path

const ParticlesBackground = () => {
  return (
    <Particles
      options={{
        particles: {
          number: {
            value: 20,
            density: {
              enable: true,
              value_area: 800,
            },
          },
          shape: {
            type: 'image',
            image: {
              src: logoImage,
              width: 500,
              height: 500,
            },
          },
          move: {
            enable: true,
            speed: 3,
          },
          opacity: {
            value: 0.5,
          },
          size: {
            value: 30,
            random: true,
          },
        },
      }}
    />
  );
};

export default ParticlesBackground;
